import React from 'react';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import UserProfile from '../screens/sideNavigatorBar/UserProfile'; // Adjust the path to point to your UserProfile file
import UserBottomNavigator from './UserBottomNavigator'; // Adjust the path to point to your UserBottomNavigator file
import TopBar from '../components/Common/TopNavBar'; // Adjust the path to point to your TopBar component

const Stack = createNativeStackNavigator();

function UserProfileStack() {
  return (
    <Stack.Navigator screenOptions={{ headerShown: false }}>
      <Stack.Screen 
        name="UserProfile" 
        component={UserProfile} 
        options={{
          header: () => <TopBar />,
          headerShown: true, // Show the header for this screen
        }}
      />
      <Stack.Screen name="UserBottomNavigator" component={UserBottomNavigator} />
    </Stack.Navigator>
  );
}

export default UserProfileStack;
